## initial attempts at a suite of functions estimating forest volume, biomass, 
## and carbon

#Examples follow what is described in Woodall et al. 2011


#Example 1: Volume, biomass, and carbon calculations for a live growing-stock tree
#Example tree information: live (STATUSCD = 1) growing stock (TREECLCD = 2) quaking
#aspen (SPCD = 746) that is 10.5 inches d.b.h.
#
#V1=4 #top diameter outside bark (in)
#dbh=10.5 #diameter at breast height (in)
#SI=66 #site index (ft)
#BA=72.53 #basal area of live trees on plot (sqft per acre)
#
### Function for predicted bole length ##
#
#V2=4.5+6.4301*(1-exp(-0.23545*dbh)^1.338)*SI^0.4737*
#      (1.00001-4.5/10.5)^0.73385*72.53^0.08228
#  
#VOLCFGRS=(0.0030086 + 0.0020355*dbh + -0.0030018*V1+
#          0.000062381*dbh^2 + 0.000025705*(dbh^2)*V2 + -0.000007009*(V2^2) +
#   0.000036708*V2*(V1^2) + 0.000000000814*(dbh^2)*(V2^3) + 
#  -0.0000000019*(dbh^2)*(V2^2)*(V1))*79*(91.51 + 0.37*dbh) / 100
#
#
### Function for VOLCFGRS ##  
#  
#  #46.11 # predicted bole length (ft)
#  #12.74 # predicted VOLCFGRS (cu ft)
#
#VOLCFSND = VOLCFGRS*(1 -(5.2-0.1)/100)
