## EXAMPLE 1: volume, bomass, and carbon for a live growing-stock tree
## STEP 1: PREDICT GROSS VOLUME (LAKE STATES FOR NOW)

VOLCFGRS=function(SPCD,DBH,SICOND,BALIVE){
  if(SPCD==746){ #aspen                                          
  B0=0.0030086;	B1=0.0020355;	B2=-0.0030018; B3=0.000062381; B4=0.000025705;	
  B5=-0.000007009; B6=0.000036708; B7=0.000000000814;	B8=-0.0000000019; B9=79;	
  B10=91.51; B11=0.37; B12=4.5; B13=6.4301;	B14=0.23545; B15=1.338;	B16=0.4737;	
  B17=1.00001; B18=0.73385; B19=0.08228}
#  else if(SPCD==2){                                      #for later...
#  B0=0.0030086;	B1=0.0020355;	B2=-0.0030018; B3=0.000062381; B4=0.000025705;	
#  B5=-0.000007009; B6=0.000036708; B7=0.000000000814;	B8=-0.0000000019; B9=79;	
#  B10=91.51; B11=0.37; B12=4.5; B13=6.4301;	B14=0.23545; B15=1.338;	B16=0.4737;	
#  B17=1.00001; B18=0.73385; B19=0.08228}
          else{     #These are SPCD=12 parms 
   B0=0.0030086;	B1=0.0020355;	B2=-0.0030018; B3=0.000062381; B4=0.000025705;	
   B5=-0.000007009; B6=0.000036708; B7=0.000000000814;	B8=-0.0000000019; B9=79;	
   B10=99.92; B11=0; B12=4.5; B13=14.304;	B14=0.19894; B15=1.4195;	B16=0.23349;	
   B17=1.00001; B18=0.76878; B19=0.12399}
   V1 = 4 # top diameter outside bark
   V2 = B12+B13*(1-exp(-B14*DBH))**B15*SICOND**B16*(B17-(V1/DBH))**B18*
        BALIVE**B19 # predicted bole length
  VOLCFGRS = ((B0+(B1*DBH)+(B2*V1)+(B3*DBH**2)+(B4*DBH**2*V2)+(B5*V2**2)
				+(B6*V2*V1**2)+(B7*DBH**2*V2**3)+(B8*DBH**2*V2**2*V1))
				*B9*(B10+(B11*DBH)))/100 #gross volume 
  return(VOLCFGRS)}
  
tree$VOLCFGRS=ifelse(tree$DBH>=5.0,mapply(VOLCFGRS,SPCD=tree$SPCD,DBH=tree$DBH,
                    SICOND=tree$SICOND,BALIVE=tree$BALIVE),NA)

## STEP 2: PREDICT SOUND VOLUME (LAKE STATES FOR NOW)

VOLCFSND=function(SPCD,VOLCFGRS,TREECLCD){
  if(SPCD==746){ #aspen                                          
    if(TREECLCD==2){B1=5.2; B2=0.1}
    else if(TREECLCD==3){B1=21.8; B2=0.15}
    else if(TREECLCD==31){B1=21.8; B2=0.15}
    else{B1=61.8; B2=0.75}            
  }
#  else if(SPCD==2){                                      #for later...
#    if(TREECLCD==2){B1=5.2; B2=0.1}
#    else if(TREECLCD==3){B1=21.8; B2=0.15}
#    else if(TREECLCD==31){B1=21.8; B2=0.15}
#    else{B1=61.8; B2=0.75}            
#  }
   else{     #These are SPCD=12 parms 
    if(TREECLCD==2){B1=2.1; B2=0.1}
    else if(TREECLCD==3){B1=11.1; B2=0.15}
    else if(TREECLCD==31){B1=11.1; B2=0.15}
    else{B1=63.4; B2=0.75}            
  }
  VOLCFSND = VOLCFGRS*(1-((B1*B2)/100)) #sound volume 
  return(VOLCFSND)} 
  
tree$VOLCFSND=ifelse(tree$DBH>=5.0,mapply(VOLCFSND,SPCD=tree$SPCD,VOLCFGRS=tree$VOLCFGRS,
                     TREECLCD=tree$TREECLCD),NA)
                     

## STEP 3: PREDICT BOLE BIOMASS (LAKE STATES FOR NOW)

DRYBIO_BOLE=function(SPCD,VOLCFSND){
  if(SPCD==746){ #aspen                                          
   WOOD_SPGR_GREENVOL_DRYWT=0.35; BARK_VOL_PCT=14.4; 
   BARK_SPGR_GREENVOL_DRYWT=0.5}
#  else if(SPCD==2){                                      #for later...
#   WOOD_SPGR_GREENVOL_DRYWT=0.33; BARK_VOL_PCT=12; 
#   BARK_SPGR_GREENVOL_DRYWT=0.4            
#  }
   else{     #These are SPCD=12 parms 
   WOOD_SPGR_GREENVOL_DRYWT=0.33; BARK_VOL_PCT=12; 
   BARK_SPGR_GREENVOL_DRYWT=0.4}
   
  DRYBIO_BOLEWOOD = VOLCFSND*WOOD_SPGR_GREENVOL_DRYWT*62.4
  DRYBIO_BOLEBARK = VOLCFSND*(BARK_VOL_PCT/100)*BARK_SPGR_GREENVOL_DRYWT*62.4
  DRYBIO_BOLE = DRYBIO_BOLEWOOD+DRYBIO_BOLEBARK #bole biomass 
  return(DRYBIO_BOLE)} 
  
tree$DRYBIO_BOLE=ifelse(tree$DBH>=5.0,mapply(DRYBIO_BOLE,SPCD=tree$SPCD,VOLCFSND=tree$VOLCFSND),NA) 



