## STEP 5: PREDICT STUMP VOLUME AND BIOMASS
## (LAKE STATES FOR NOW)

DRYBIO_STUMP=function(SPCD,DBH,CRM_AF){
  if(SPCD==746){ #aspen                                          
    RAILE_STUMP_DOB_B1=0.09658;	RAILE_STUMP_DIB_B1=0.91882;	
    RAILE_STUMP_DIB_B2=0.08593; WOOD_SPGR_GREENVOL_DRYWT=0.35;  
    BARK_SPGR_GREENVOL_DRYWT=0.5}
#  else if(SPCD==2){                                      #for later...
#    RAILE_STUMP_DOB_B1=0.09658;	RAILE_STUMP_DIB_B1=0.91882;	
#    RAILE_STUMP_DIB_B2=0.08593; WOOD_SPGR_GREENVOL_DRYWT=0.35;  
#    BARK_SPGR_GREENVOL_DRYWT=0.5}
   else{     #These are SPCD=12 parms 
    RAILE_STUMP_DOB_B1=0.09658;	RAILE_STUMP_DIB_B1=0.91882;	
    RAILE_STUMP_DIB_B2=0.08593; WOOD_SPGR_GREENVOL_DRYWT=0.33; 
   BARK_SPGR_GREENVOL_DRYWT=0.4}
   
	STUMP_VOSB = (3.14159265*(DBH**2))/(4*144)*(((1-RAILE_STUMP_DOB_B1)**2*1+11*RAILE_STUMP_DOB_B1*(1-RAILE_STUMP_DOB_B1)*log(1+1)-30.25/(1+1)*RAILE_STUMP_DOB_B1**2)
					-((1-RAILE_STUMP_DOB_B1)**2*0+11*RAILE_STUMP_DOB_B1*(1-RAILE_STUMP_DOB_B1)*log(0+1)-30.25/(0+1)*RAILE_STUMP_DOB_B1**2)) #stump volume outside bark
	STUMP_VISB = (3.14159265*(DBH**2))/(4*144)*(((RAILE_STUMP_DIB_B1-RAILE_STUMP_DIB_B2)**2*1+11*RAILE_STUMP_DIB_B2*(RAILE_STUMP_DIB_B1-RAILE_STUMP_DIB_B2)*log(1+1)-30.25/(1+1)*RAILE_STUMP_DIB_B2**2)
					-((RAILE_STUMP_DIB_B1-RAILE_STUMP_DIB_B2)**2*0+11*RAILE_STUMP_DIB_B2*(RAILE_STUMP_DIB_B1-RAILE_STUMP_DIB_B2)*log(0+1)-30.25/(0+1)*RAILE_STUMP_DIB_B2**2)) #stump volume inside bark
	STUMP_ODSW = STUMP_VISB*WOOD_SPGR_GREENVOL_DRYWT*62.4 #stump wood biomass
	STUMP_ODSB = (STUMP_VOSB-STUMP_VISB)*BARK_SPGR_GREENVOL_DRYWT*62.4 #stump bark biomass
	DRYBIO_STUMP = (STUMP_ODSW+STUMP_ODSB)*CRM_AF #total stump biomass
  return(DRYBIO_STUMP)} 

tree$DRYBIO_STUMP=ifelse(tree$DBH>=5.0,mapply(DRYBIO_STUMP,SPCD=tree$SPCD,DBH=tree$DBH,
                        CRM_AF=tree$CRM_AF),NA) 
                        

