    JENKINS_ROOT_RATIO_B1=-1.6911; JENKINS_ROOT_RATIO_B2=0.816;}
  else if(JENKINS_SPGRPCD==10){                            #juniper/oak/mesquite
    JENKINS_TOTAL_B1=-0.7152; JENKINS_TOTAL_B2=1.7029;
    JENKINS_STEM_WOOD_RATIO_B1=-0.3737; JENKINS_STEM_WOOD_RATIO_B2=-1.8055;
    JENKINS_STEM_BARK_RATIO_B1=-2.098; JENKINS_STEM_BARK_RATIO_B2=-1.1432;
    JENKINS_FOLIAGE_RATIO_B1=-2.9584; JENKINS_FOLIAGE_RATIO_B2=4.4766;
    JENKINS_ROOT_RATIO_B1=-1.5619;  JENKINS_ROOT_RATIO_B2=0.6614}
    
	BIO_ABOVE_JENKINS = (exp(JENKINS_TOTAL_B1+JENKINS_TOTAL_B2*log(DBH*2.54)))*2.20462 #total above-ground biomass (lbs) from Jenkins et al. 2003;
  BIO_BOLE_RATIO = exp(JENKINS_STEM_WOOD_RATIO_B1+(JENKINS_STEM_WOOD_RATIO_B2/(DBH*2.54)))
	BIO_BARK_RATIO = exp(JENKINS_STEM_BARK_RATIO_B1+(JENKINS_STEM_BARK_RATIO_B2/(DBH*2.54)))
	BIO_FOL_RATIO = exp(JENKINS_FOLIAGE_RATIO_B1+(JENKINS_FOLIAGE_RATIO_B2/(DBH*2.54)))
	MST = BIO_ABOVE_JENKINS*(BIO_BARK_RATIO+BIO_BOLE_RATIO) #merchantable oven-dry bole biomass (lbs) from Jenkins et al.  2004;
	FOL = BIO_ABOVE_JENKINS*(BIO_FOL_RATIO); #merchantable oven-dry bole biomass (lbs) from Jenkins et al.  2004;
	CRM_AF = DRYBIO_BOLE/MST #component ratio method adjustment factor;     
  DRYBIO_TOP = (BIO_ABOVE_JENKINS-MST-(DRYBIO_STUMP/CRM_AF)-FOL)*CRM_AF #*top and branch biomass;
  return(DRYBIO_TOP)} 
  
tree$DRYBIO_TOP=ifelse(tree$DBH>=5.0,mapply(DRYBIO_TOP,JENKINS_SPGRPCD=tree$JENKINS_SPGRPCD,
                      DBH=tree$DBH,DRYBIO_STUMP=tree$DRYBIO_STUMP,
                      DRYBIO_BOLE=tree$DRYBIO_BOLE),NA)


tree$BIOMASS=ifelse(tree$DBH>=5.0,tree$DRYBIO_BOLE+tree$DRYBIO_STUMP+tree$DRYBIO_TOP,tree$CRM_AF) 
tree$CARBON=tree$BIOMASS*0.5
                     
                                               

print(tree)



